$(window).scroll(function () {
  const currentPos = $(window).scrollTop();
  if (currentPos > 555) {
    $(`.scroll`).fadeIn();
  } else $(`.scroll`).fadeOut();
});

$(`.scroll`).click(function (e) {
  e.preventDefault();
  $(`html,body`).animate(
    {
      scrollTop: 0,
    },
    500
  );
});

