$(".minus").click(function (e) {
  e.preventDefault();
  let curAmount = Number($(".amountChose").val());
  if (curAmount > 1) {
    if (curAmount <= 10) {
      curAmount--;
      $(".amountChose").val("0" + curAmount);
    } else {
      curAmount--;
      $(".amountChose").val(curAmount);
    }
  }
});
$(".plus").click(function (e) {
  e.preventDefault();
  let curAmount = Number($(".amountChose").val());
  if (curAmount < 9) {
    curAmount++;
    $(".amountChose").val("0" + curAmount);
  } else {
    curAmount++;
    $(".amountChose").val(curAmount);
  }
});

function appendToList(val) {
  $(`<li>${val}</li>`).appendTo("header .option-list");
}
function hideList() {
  $("header .option-list").fadeOut();
}

/** =========login========= */

$(function () {
  const dataUser = [
    {
      username: "admin",
      password: "admin",
    },
    {
      username: "client",
      password: "client",
    },
  ];
  $(".login").click(function (e) {
    e.preventDefault();
    e.stopPropagation();
    // localStorage.clear();
    if (machWithUser($(".username").val(), $(".password").val()) == true) {
      localStorage.setItem("user", $(".username").val());
      localStorage.setItem("pass", $(".password").val());
      window.location.assign("http://localhost:3000/fish.html");
    }
  });
  const machWithUser = (name, pass) => {
    for (let i = 0; i < dataUser.length; i++) {
      if (dataUser[i].username == name.toLowerCase()) {
        if (dataUser[i].password == pass.toLowerCase()) {
          $(".messageLogin").text("Thành Công");
          return true;
        } else {
          return $(".messageLogin").text("Bạn nhập sai Username hoặc Password");
        }
      }
      if (i + 1 == dataUser.length) {
        return $(".messageLogin").text("Bạn nhập sai Username hoặc Password");
      }
    }
  };
});

