/**========== giỏ hàng ========== */

$(function () {
  const cart = [];
  const renderAddCart = (stock) => {
    stock.forEach((val) => {
      $(`
      <li>${val.name} <span>${val.price}</span> <span>${val.amount}</span></li>
      `).appendTo(".cart-info");
    });
  };
  const renderSumPrice = (list) => {
    let sumPrice = 0;
    list.forEach((val) => {
      sumPrice += Number(val.price) * val.amount;
    });
    $(`<span>Tổng Tiền : </span> <span>${sumPrice}</span>`).appendTo(
      ".cart-info"
    );
  };
  $("#clickAddCart").click(function (e) {
    e.preventDefault();
    cart.push({
      name: $("#nameStock").text(),
      price: $("#priceStock").text(),
      amount: $(".amountChose").val(),
    });
    $(".cart-info").empty();
    renderAddCart(cart);
    renderSumPrice(cart);
  });
});

